import React from 'react'
import Profile from "../img/prof.svg"

function ImageProfile() {
  return (
    <div className='container_pdp'>

        <img  src={Profile} className="pdp" onClick={console.log("hello")} alt=""/>
    </div>
  )
}

export default ImageProfile
